import React from 'react';
import Button from './Button'

const Header = ({title}) => {
    return(
        <div className='header'>
            <h1>{title}</h1>
            <input type="text" className='Search-Box' placeholder='Enter a subreddit'/>
            <Button text={"Retrieve top 10 posts"} colour={"red"}/>
        </div>
    )
}

Header.defaultProps={
    title: 'Reddit Hotness Grabber'
}
export default Header;
